میانگین کلاس ۳۰ نفری ۲۰ نفری که نمره ۸۰ دارند، ۸ نفر که نمره ۹۰ دارند و ۲ نفر که نمره ۱۰۰ دارند است. میانگین کلاس ۲۰ نفر که نمره ۸۰ دارند ۱۶۰ است (۲۰×۸۰). میانگین کلاس ۸ نفر که نمره ۹۰ دارند ۷۲ است (۸×۹۰). میانگین کلاس ۲ نفر که نمره ۱۰۰ دارند ۲۰۰ است (۲×۱۰۰). میانگین کلاس ۳۰ نفری ۱۹۶ است (۱۶۰+۷۲+۲۰۰)/۳۰.  \[
\frac{160+72+200}{30}=\frac{432}{30}=\boxed{14.4}
